import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import All from "./All";

function App() {
  return (
    <>
      <>
        <Router>
          <Switch>
            <Route exact path="/all" component={Home} />
          </Switch>
        </Router>
      </>
    </>
  );
}

export default App;
